import React, { useState } from 'react';
import { AppBar, Toolbar, Typography, Button } from '@mui/material';
import { Menu, MenuItem, MenuList } from '@mui/material';
import { Link } from 'react-router-dom';
import Theme from '../components/Theme';
import pathwaysData from '../data/pathwaysData.json';

function Header() {
  const [anchorEl, setAnchorEl] = useState(null);
  const [subMenuOpen, setSubMenuOpen] = useState(false);

  const handleClick = (event) => {
    setAnchorEl(event.currentTarget);
    setSubMenuOpen(true);
  };

  const handleClose = () => {
    setAnchorEl(null);
    setSubMenuOpen(false);
  };

  return (
    <AppBar position="static" style={{ background: Theme.colors.primary }}>
      <Toolbar>
        <Typography variant="h6" component="div" sx={{ flexGrow: 1, fontWeight: 'bold', letterSpacing: '1px' }}>
          Kei Te Ao WhakamƒÅramatanga: UNDEFINED
        </Typography>
        <Button color="inherit" component={Link} to="/">Home</Button>
        <Button color="inherit" component={Link} to="/build">Build Your Pathway</Button>
        <Button
          color="inherit"
          aria-controls="pathway-menu"
          aria-haspopup="true"
          onClick={handleClick}
        >
          Explore Pathways
        </Button>
        <Menu
          id="pathway-menu"
          anchorEl={anchorEl}
          open={Boolean(anchorEl)}
          onClose={handleClose}
        >
          <MenuItem
            onClick={handleClose}
            component={Link}
            to="/digital-technology"
          >
            Digital Technology
          </MenuItem>
        </Menu>
        {subMenuOpen && (
          <MenuList>
            {pathwaysData.techPaths.map((pathway, index) => (
              <MenuItem
                key={index}
                component={Link}
                to={`/techpaths/${index}`}
                onClick={handleClose} // Close the menu when an item is clicked
              >
                {pathway.title}
              </MenuItem>
            ))}
          </MenuList>
        )}
        {/* Add other navigation buttons as needed */}
      </Toolbar>
    </AppBar>
  );
}

export default Header;
